(function(){(function(){var $,appbar,backdrop,burgerbutton,capitalize,closeMenu,mpEventName,navbar,socialLinks,toggleMenu;$=document.querySelector.bind(document);navbar=$(".navdrawer-container");appbar=$(".app-bar");backdrop=$(".backdrop");burgerbutton=$(".menu");socialLinks=$(".social-items");closeMenu=function(){appbar.classList.remove("open");navbar.classList.remove("open");return backdrop.classList.remove("open")};toggleMenu=function(){appbar.classList.toggle("open");navbar.classList.toggle("open");return backdrop.classList.toggle("open")};capitalize=function(string){return string.charAt(0).toUpperCase()+string.slice(1)};mpEventName=function(evt){return capitalize(evt.target.href.split("#")[1])};backdrop.addEventListener("click",closeMenu);burgerbutton.addEventListener("click",toggleMenu);navbar.addEventListener("click",function(event){if(event.target.nodeName==="A"||event.target.nodeName==="LI"){mixpanel.track("Click",{Section:mpEventName(event)});return closeMenu()}});return socialLinks.addEventListener("click",function(event){if(event.target.nodeName==="A"||event.target.nodeName==="I"){if(event.target.id==="email"){return mixpanel.track("Clicked on email")}else{return mixpanel.track("Socializing",{"Social profile":capitalize(event.target.id)})}}})})()}).call(this);